const getdronesPosition = async () => {
  const reponse = await fetch(
    "https://assignments.reaktor.com/birdnest/drones",
    {
      method: "GET",
      "Content-Type": "application/xml; charset=utf-8",
    }
  );
  const jsonData = new XMLParser().parseFromString(reponse.data);
  return jsonData;
};

